import React from "react";
import Footer from "../component/profile";
import Linker from "../component/links";
import Share from "../component/share";
import Socials from "../component/socials";

const Home = () => {
  return (
    <div>
      <Share />
     
      <Linker />

      <Socials />
    </div>
  );
}

export default Home
